import React, { useRef } from 'react';
import Logo from './components/logo';
import Navigation from './components/navigation';
import Heading from './components/heading';

function App() {
  return (
    <>
      <section className="h-screen container p-20 mx-auto">
        <header>
          <Navigation link1='download my resume' link2='portfolio' link3='contact' link4='blog' />
        </header>
        <section>
          <Heading heading="HI, I'M GLENN PHILLIPS!" subheading={`I'm a front-end developer {\n} from the US.`} />
          <Logo title='Hi!' />
        </section>
      </section>
      <main>

      <Text text='Hello world!' i={9} />
        <h1 className="text-3x1">Hello!</h1>
        <p className="text-3x1 font-bold underline">Hello!</p>

      </main>
      <footer>

      </footer>
    </>
  );
}

interface Props {
  text: string;
  i: number;
  obj?: {

  }
  handleChange?: React.ChangeEventHandler<HTMLInputElement>;
}

const Text: React.FC<Props> = ({ handleChange }) => {
  const inputRef = useRef<HTMLInputElement>(null);

  return (
    <form>
    <input ref={inputRef} onChange={handleChange}/>
    <input type="reset"/>
    <input type="submit"/>
    </form>
  );
};

export default App;
